useEffect(() => {
  const apiUrl = process.env.REACT_APP_API_URL;
  fetch(`${apiUrl}/api/message`)
    .then((res) => res.json())
    .then((data) => setMessage(data.message))
    .catch((err) => console.error('Error fetching API:', err));
}, []);
